<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>炉桥驾校——钥匙柜密码查看页</title>
    <style>
        body {
            font-family: 'Arial', sans-serif;
            background-color: #f4f4f9;
            color: #333;
            margin: 0;
            padding: 20px;
            display: flex;
            flex-direction: column;
            align-items: center;
            min-height: 100vh;
        }
        .container {
            background: #fff;
            border-radius: 8px;
            box-shadow: 0 4px 10px rgba(0, 0, 0, 0.1);
            padding: 20px;
            width: 100%;
            max-width: 600px;
            text-align: center;
        }
        .time {
            font-size: 20px;
            font-weight: bold;
            color: #2c3e50;
            margin-bottom: 10px;
        }
        .password {
            font-size: 20px;
            font-weight: bold;
            color: #2980b9;
        }
        .auth-code-input {
            display: none;
            margin-bottom: 20px;
        }
        .auth-code-input input {
            width: calc(100% - 120px); /* 调整宽度 */
            padding: 10px;
            margin-right: 10px;
            border: 1px solid #bdc3c7;
            border-radius: 4px;
            font-size: 16px;
        }
        .auth-code-input button {
            padding: 10px 20px;
            background-color: #2980b9;
            color: #fff;
            border: none;
            border-radius: 4px;
            cursor: pointer;
            font-size: 16px;
        }
        .auth-code-input button:hover {
            background-color: #2c3e50;
        }
        .debug-info {
            font-size: 14px;
            color: #bdc3c7;
            margin-top: 20px;
        }
    </style>
</head>
<body>
    <div class="container">
        <!-- 第一部分：动态显示当前的年月日和时间 -->
        <div class="time" id="current-time"></div>

        <!-- 第三部分和第四部分 -->
        <div class="password" id="password-display">
            正在加载。。。。
        </div>

        <!-- 第五部分：密码框 -->
        <div class="auth-code-input" id="auth-code-input">
            <input type="text" id="auth-code" placeholder="请输入授权码">
            <button onclick="checkAuthCode()">确认</button>
        </div>
    </div>
